db.patients.aggregate([    {        $unwind: "$ENCOUNTERS"    },    {        $unwind: "$ENCOUNTERS.MEDICATIONS"    },    {        $match: {            "ENCOUNTERS.MEDICATIONS.NAME": "Simvastatin 10 MG Oral Tablet"        }    },    {        $group: {            _id: {                MEDICATION_NAME: "$ENCOUNTERS.MEDICATIONS.NAME"            },            success_count: {                $sum: {                    $cond: [                        { $eq: ["$ENCOUNTERS.MEDICATIONS.OUTCOME", "success"] }                    ]
                    }
                }
            }
        },
        {
            $project: {
                _id: 0,
                MEDICATION_NAME: "$_id.MEDICATION_NAME",
                success_rate: {
                    $cond: {
                        if: { $gt: [{ $divide: ["$success_count", 1] }, 0] },
                        then: { $multiply: [{ $divide: ["$success_count", { $size: "$$ROOT" }] }, 100] },
                        else: 0
                    }
                }
            }
        }
    ]);

db.patients.aggregate([    {        $unwind: "$ENCOUNTERS"    },    {        $unwind: "$ENCOUNTERS.MEDICATIONS"    },    {        $match: {            "ENCOUNTERS.MEDICATIONS.NDC": "NDA020800 0.3 ML Epinephrine 1 MG/ML Auto-Injector"        }    },    {        $group: {            _id: null,            success_count: {                $sum: {                    $cond: [                        { $eq: ["$ENCOUNTERS.MEDICATIONS.OUTCOME", "success"] }, 1, 0]                    }
                }
            }
        },
        {
            $project: {
                _id: 0,
                success_rate: {
                    $cond: [
                        { $eq: [{ $divide: ["$success_count", { $size: "$ENCOUNTERS" }] }, 0] },
                        0,
                        { $multiply: [{ $divide: ["$success_count", { $size: "$ENCOUNTERS" }] }, 100] }
                    ]
                }
            }
        }
    ]);
